package com.dy.utils;

import com.sun.jna.Library;
import com.sun.jna.Native;

public class Verify {
	public interface Mydll extends Library { 	    
		Mydll INSTANCE = (Mydll) Native.loadLibrary("Match", Mydll.class);
	    boolean process(String reg,String verify);
	}
	public boolean test(String reg,String verify) { 
		System.out.println("注册指纹"+reg);
		System.out.println("对比指纹"+verify);
		//verify="";
		//		verify="";
		//System.getProperty("java.classpath");
		Mydll mydll = Mydll.INSTANCE;
		//两个指纹特征模板的string串
		boolean flag=mydll.process(reg,verify);
		System.out.println(flag);
		return flag;
	    } 
		
}
